import { useEffect } from 'react';
import { useLocation } from 'react-router-dom';
import DashboardPage from '../../pages/dashboard/index';
import EmployerJobPage from '../../pages/employer/jobs/jobs';
import CertificationCoursesComponent from '../../pages/employer/certifications/certifications';
import EmployerPostJobPage from '../../pages/employer/jobs/postJobs';
import CompanyRegisterPage from '../../pages/employer/companyRegistration';
import EmployerBillingPage from '../../pages/employer/billing';
import EmployerHeader from '../header/employersHeader';
import EmployerSideBar from '../sidebar/index';
// import JobPostPayment from '../../pages/employer/jobs/jobPostPayment';
import EmployerUserProfile from '../../pages/employer/userProfile'
import '../header/style.scss';
import ViewJobsPageComponent from '../../pages/employer/jobs/view-jobs';
import SubscriptionPlans from '../../pages/employer/registrationWizard/subscription-plans';
import ExplorePageComponent from '../../pages/parttimer/explore';
import ViewCandidates from '../../pages/employer/viewCandidates';
import AppliedCandidates from '../../pages/employer/certifications/appliedCandiates';

import JobPaymentComponent from '../../pages/employer/jobs/jobPostPayment';
import { loadStripe } from '@stripe/stripe-js';
import { Elements } from '@stripe/react-stripe-js';
import CompanyRegistration from '../../pages/employer/companyRegistration';
import SubscriptionComponent from '../../pages/subscription';
import EmployeeDetailsView from '../../pages/employer/employeeDetailsView';
import Footer from '../footer';
import CreateCertification from '../../pages/employer/certifications/createCertifications';
import ViewCertificateComponent from '../../pages/employer/certifications/viewCertificate';
import ViewAppliedCandidates from '../../pages/employer/certifications/viewAppliedList';




export default function EmployerLayout(props) {
  const stripePromise = loadStripe('pk_test_q0EkRgcb9o2Rucwj8sbkLOsh');

  const { pageTitle, roles } = props;
  const location = useLocation();
  const loginType = JSON.parse(localStorage.getItem('currentUser'));
  if (roles && loginType?.types) {
    if (!roles.every((val) => loginType?.types?.includes(val))) {
      window.open(window.location.origin + '/', "_self")
    }
  }

  useEffect(() => {
    const body = document.querySelector('body');
    if (location.pathname === '/company-registration') {
      body.classList.add('noSideBar');
    } else {
      body.classList.remove('noSideBar');
    }
    if (location.pathname === '/employersubscription') {
      body.classList.add('noSideBar');
    }
    return () => {
      body.classList.remove('noSideBar');
    };

  }, [location.pathname]);

  return (
    <>
      {/* Employer Admin Layout Start */}
      <div className="employerDashboardLayout">
        <EmployerSideBar />
        <div className="employerDashboardRight">
          <EmployerHeader />
          {pageTitle === 'dashboard' ? <DashboardPage /> : null}
          {pageTitle === 'jobs' ? <EmployerJobPage /> : null}

          {pageTitle === 'viewjob' ? <ViewJobsPageComponent /> : null}
          {pageTitle === 'payment' ? <SubscriptionPlans /> : null}
          {pageTitle === 'postJob' ? <EmployerPostJobPage /> : null}
          {pageTitle === 'jobPostPayment' ? <JobPaymentComponent /> : null}
          {pageTitle === 'userProfile' ? <EmployerUserProfile /> : null}
          {pageTitle === 'viewCandidate' ? <ViewCandidates /> : null}
          {/* companyRegister */}
          {pageTitle === 'companyRegister' ? <CompanyRegisterPage /> : null}
          {pageTitle === 'employersubscription' ? <SubscriptionComponent /> : null}
          {pageTitle === 'employeeview' ? <EmployeeDetailsView /> : null}
          {/* postJob */}
          {pageTitle === 'certifications' ? <CertificationCoursesComponent /> : null}
          {pageTitle === 'applied-list-certifications' ? <AppliedCandidates /> : null}
          {pageTitle === 'createCertification' ? <CreateCertification /> : null}
          {pageTitle === 'viewCertificate' ? <ViewCertificateComponent /> : null}
          {pageTitle === 'viewAppliedList' ? <ViewAppliedCandidates /> : null}


          <Elements stripe={stripePromise} >
            {pageTitle === 'billing' ? <EmployerBillingPage /> : null}
          </Elements>

        </div>
        <Footer/>
      </div>
      {/* Employer Admin Layout End */}


    </>
  );
}
